package com.ecfingerprint.ecfingerprint.controller;
import com.bbl.util.model.GenDataBlock;
import com.bbl.util.model.SocketPayload;
import com.fasterxml.jackson.databind.JsonNode;
import com.fasterxml.jackson.databind.ObjectMapper;
import org.springframework.http.HttpEntity;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.PostMapping;
import java.io.IOException;
import java.util.HashMap;

@Controller
public class AfisController {
    @PostMapping("/callEcSdk")
    public String callEcSdk(HttpEntity<String> httpEntity) throws IOException {
        String jsonResponse = httpEntity.getBody();
        System.out.println(jsonResponse);

//        String right_thumb = "";
//        String right_index = "";
//        String left_thumb =  "";
//        String left_index = "";

        JsonNode jsonNode = new ObjectMapper().readTree(jsonResponse);
        String dateOfBirth = jsonNode.get("dateOfBirth").asText();
        String nid = jsonNode.get("nid").asText();
        String right_thumb = jsonNode.get("right_thumb").asText();
        String right_index = jsonNode.get("right_index").asText();
        String left_thumb = jsonNode.get("left_thumb").asText();
        String left_index = jsonNode.get("left_index").asText();




        //socketmsgparser call

        SocketPayload socketRequestPayload = SocketPayload.getInstance();
        GenDataBlock genDataBlock = GenDataBlock.getInstance();
        HashMap<String, String> formData = new HashMap<>();
        formData.put("nid10Digit", nid);
        formData.put("dateOfBirth", dateOfBirth);
        formData.put("RIGHT_THUMB", right_thumb);
        formData.put("RIGHT_INDEX", right_index);
        formData.put("LEFT_THUMB", left_thumb);
        formData.put("LEFT_INDEX", left_index);

        genDataBlock.setFormData(formData);
        socketRequestPayload.setGenDataBlock(genDataBlock);
        SocketPayload socketPayloadResponse = SocketPayload.getInstance().toObject(jsonResponse);
        System.out.println(socketPayloadResponse.toObject(jsonResponse));


        return "";
    }

}
